package com.ufgov.zc.server.zc.service.impl;import java.util.List;import com.ufgov.zc.common.console.model.AsEmp;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.common.zc.model.ZcEbPlan;import com.ufgov.zc.common.zc.model.ZcEbPresent;import com.ufgov.zc.server.zc.dao.IZcEbPresentDao;import com.ufgov.zc.server.zc.service.IZcEbPresentService;public class ZcEbPresentService implements IZcEbPresentService {  private IZcEbPresentDao presentDao;  public IZcEbPresentDao getPresentDao() {    return presentDao;  }  public void setPresentDao(IZcEbPresentDao presentDao) {    this.presentDao = presentDao;  }  public void delete(ZcEbPresent present, RequestMeta requestMeta) {    presentDao.delete(present, requestMeta);  }  public List getPresentList(ElementConditionDto elementConditionDto, RequestMeta requestMeta) {    return presentDao.getPresentList(elementConditionDto, requestMeta);  }  public void insert(ZcEbPresent present, RequestMeta requestMeta) {    presentDao.insert(present, requestMeta);  }  public ZcEbPresent update(ZcEbPresent present, RequestMeta requestMeta) {    ZcEbPresent retPresent = presentDao.getZcEbPresentById(present);    if (retPresent == null) {      return presentDao.insert(present, requestMeta);    } else {      return presentDao.update(present, requestMeta);    }  }  public AsEmp getComplany(ElementConditionDto elementConditionDto, RequestMeta requestMeta) {    return presentDao.getComplany(elementConditionDto, requestMeta);  }  public List getSupplierList(ElementConditionDto elementConditionDto, RequestMeta requestMeta) {    return presentDao.getSupplierList(elementConditionDto, requestMeta);  }  public List getZcEbOpenBidTeamMemberList(ElementConditionDto elementConditionDto, RequestMeta requestMeta) {    return presentDao.getZcEbOpenBidTeamMemberList(elementConditionDto, requestMeta);  }  public ZcEbPlan getZcEbPlan(ElementConditionDto elementConditionDto, RequestMeta requestMeta) {    return presentDao.getZcEbPlan(elementConditionDto, requestMeta);  }}